  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"January 3, 2006    Mr. Bradley Decker
    \ Federal Election Commission  Washington, DC 20463    RE:\t\t\t\tRepublican Party
    of Texas  Identification Number:\tC00143743  Report:\t\t\t\tAmended February Report\t\t\t\t\t\t\t\t\t(January
    1, 2005 through January 31, 2005)    Filed\t\t\t\tNovember 28, 2005    Dear Mr.
    Decker:    Pursuant to your letter dated, December 2, 2005, regarding the Amended
    February Report, we are responding (as listed below).      1).\tPer our discussion
    regarding the debt/obligation of $3,750 payable to Strategy Group for Media, Inc.
    originally reported on our amended Year End Report filed July 22, 2005, you explained
    that this is not a reportable debt and that it was incorrectly included on this
    report.  We have removed the debt/obligation from this amended February Report.
    \   Additionally, in response to your September 21, 2005, request for more information,
    we disclosed the in-kind contribution (expenditure) incurred on behalf of Wohlgemuth
    for Congress made in 2004 and reported on Schedule B, Line 23.  This was in the
    memo text attached to our amended February Report filed October 21, 2005.  Also
    on this amended report, we moved the expenditure to Line 21(b) as a memo entry
    to report the payment as directed in your letter.      It appears that when we
    subsequently amended this report on November 28, 2005, the memo payment was inadvertently
    moved back to Schedule B, Line 23 in an effort to offset the expenditure reported
    earlier on Schedule B, Line 23 and  to eliminate the debt/obligation on Schedule
    D.  Per our discussion today, I have moved the memo entry back to Schedule B,
    Line 21.  In order to avoid duplication of the 2004 expense reported on Line 21(b),
    we had to enter the disbursement amount as zero, however, $3,750 is noted in the
    memo language.    Best regards,      Christopher Maska, Treasurer  The Republican
    Party of Texas\""
